import React from 'react'
import { Link } from "react-router-dom"

const LoginAdmin = () => {
    return (
        <div>
            <h2>Login Admin Page</h2>
            <Link to='./add'>Add Product</Link>
            <Link to='./edit/:id'>Edit Product</Link>

        </div>
    )
}

export default LoginAdmin
